import {Col, Row} from "react-bootstrap";
import styles from "./Login.module.css";
import React from "react";
import {reduxForm, Field} from "redux-form";


const LoginForm = (props) =>{
    const onSubmit = (formdata) =>{
        console.log((formdata))
    }
    return(
        <form onSubmit={props.handleSubmit}>
            <Col xs='12'>
                <Field placeholder={'Введите свою почту'} name={'login'} component={'input'}/>
            </Col>
            <Col xs='12'>
                <Field placeholder={'Введите свой пароль'} name={'paswword'} component={'input'}/>
            </Col>
            <Col xs='12'>
                <Field component={'input'} name={'remberMe'} type={'checkbox'}/> Запомнить меня
            </Col>
            <Col xs='3'>
                <button>Войти</button>
            </Col>
        </form>
    )
}
const LoginReduxForm = reduxForm({form: 'login'})(LoginForm)
const Login = () =>{
    return <LoginReduxForm/>
}

export default LoginReduxForm
